def cal_smotuned(mea=""):
    F_final1 = {}
    path = os.getcwd() + "/fault_prediction/dump/"+mea+"/"
    for root, dirs, files in os.walk(path, topdown=False):
        for name in files:
            a = os.path.join(root, name)
            with open(a, 'rb') as handle:
                F_final = pickle.load(handle)
                # print(F_final)
                F_final1 = dict(F_final1.items() + F_final.items())
    temp = {}
    for i in F_final1.keys():
        temp[i]={}
        for j in F_final1[i].keys():
            temp[i][j]=F_final1[i][j][0][mea]
    return temp

